description:
Verenigde Staten / Duitsland
Thriller / Oorlog
120 minuten

goed

met Tom Cruise, Kenneth Branagh en Bill Nighy

Claus von Stauffenberg (Tom Cruise) staat dichtbij Hitler en is een dienaar in diens Derde rijk. Maar Stauffenberg walgt van de 
misdaden van de nazi-regering. Hoe langer hij de gruwelijke misdaden meemaakt, des te meer hij inziet dat Hitler een enorm gevaar 
vormt. Hij besluit samen met enkele andere officieren Hitler om te brengen door een aanslag op hem te plegen.
